import './index.css';
import Card from './Card';
import {icon} from '../static/logo.png';

export default () => (
    <>
        <header className="App">
            <img src={icon} className= "static-logo" alt="logo"/>
        </header>
        <div className="Grid">
            <Card />
            <Card />
            <Card />
        </div>
    </>
)
